sourcesContent:
import React, { useState, useCallback, useEffect } from 'react';
import {
  Box,
  Typography,
  LinearProgress,
  Alert,
  Chip,
  Grid,
  Paper,
  Stepper,
  Step,
  StepLabel,
  StepContent,
  Fade,
  Zoom,
  Slide,
  CircularProgress,
  Avatar,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  Divider,
  IconButton,
  Collapse,
  Badge,
  Card
} from '@mui/material';
import { 
  CloudUpload, 
  CheckCircle, 
  Error, 
  BugReport,
  Psychology,
  Analytics,
  Security,
  ExpandMore,
  ExpandLess,
  TrendingUp,
  Warning,
  Shield,
  Speed,
  AutoFixHigh,
  SmartToy,
  DataUsage,
  NetworkCheck,
  Assessment
} from '@mui/icons-material';
import { useDropzone } from 'react-dropzone';
import apiClient from '../config/api';
// Types defined inline

interface UploadResult {
  message: string;
  logs_processed: number;
  anomalies_detected: number;
  candidate_rules_generated: number;
  anomalies: any[];
}

interface MLProcessingStep {
  id: string;
  label: string;
  description: string;
  icon: React.ReactNode;
  completed: boolean;
  active: boolean;
  duration?: number;
}

const LogUpload: React.FC = () => {
  const [uploading, setUploading] = useState(false);
  const [uploadProgress, setUploadProgress] = useState(0);
  const [uploadResult, setUploadResult] = useState<UploadResult | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [processingSteps, setProcessingSteps] = useState<MLProcessingStep[]>([]);
  const [activeStep, setActiveStep] = useState(0);
  const [showMLInsights, setShowMLInsights] = useState(false);
  const [expandedAnomalies, setExpandedAnomalies] = useState<Set<number>>(new Set());


  const initializeMLSteps = useCallback(() => {
    const steps: MLProcessingStep[] = [
      {
        id: 'upload',
        label: 'Data Ingestion',
        description: 'Uploading and parsing log files',
        icon: <CloudUpload />,
        completed: false,
        active: false
      },
      {
        id: 'preprocessing',
        label: 'Data Preprocessing',
        description: 'Normalizing and structuring log data',
        icon: <DataUsage />,
        completed: false,
        active: false,
        duration: 2000
      },
      {
        id: 'feature_extraction',
        label: 'Feature Extraction',
        description: 'Extracting behavioral patterns and features',
        icon: <Analytics />,
        completed: false,
        active: false,
        duration: 3000
      },
      {
        id: 'ml_analysis',
        label: 'ML Analysis',
        description: 'Running anomaly detection algorithms',
        icon: <SmartToy />,
        completed: false,
        active: false,
        duration: 4000
      },
      {
        id: 'pattern_recognition',
        label: 'Pattern Recognition',
        description: 'Identifying security threats and anomalies',
        icon: <Psychology />,
        completed: false,
        active: false,
        duration: 2500
      },
      {
        id: 'rule_generation',
        label: 'Rule Generation',
        description: 'Generating security rules from findings',
        icon: <AutoFixHigh />,
        completed: false,
        active: false,
        duration: 1500
      }
    ];
    setProcessingSteps(steps);
    return steps;
  }, []);

  const simulateMLProcessing = useCallback(async (steps: MLProcessingStep[]) => {
    for (let i = 0; i < steps.length; i++) {
      setActiveStep(i);

      // Update step to active
      setProcessingSteps(prev => prev.map((step, idx) => ({
        ...step,
        active: idx === i,
        completed: idx < i
      })));

      // Wait for step duration
      if (steps[i].duration) {
        await new Promise(resolve => setTimeout(resolve, steps[i].duration));
      }

      // Complete the step
      setProcessingSteps(prev => prev.map((step, idx) => ({
        ...step,
        active: false,
        completed: idx <= i
      })));
    }
  }, []);

  const onDrop = useCallback(async (acceptedFiles: File[]) => {
    if (acceptedFiles.length === 0) return;

    console.log('ðŸ“ Files dropped:', acceptedFiles.map(f => f.name));

    setUploading(true);
    setUploadProgress(0);
    setError(null);
    setUploadResult(null);
    setShowMLInsights(false);

    // Initialize ML processing steps
    const steps = initializeMLSteps();

    try {
      const formData = new FormData();
      acceptedFiles.forEach(file => {
        formData.append('files', file);
        console.log(`ðŸ“Ž Added file: ${file.name} (${file.size} bytes)`);
      });

      // Start ML processing simulation
      const processingPromise = simulateMLProcessing(steps);

      console.log('ðŸš€ Sending request to backend...');
      const response = await apiClient.post('/api/logs/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
        onUploadProgress: (progressEvent) => {
          if (progressEvent.total) {
            const progress = Math.round((progressEvent.loaded * 100) / progressEvent.total);
            setUploadProgress(progress);
            console.log(`ðŸ“Š Upload progress: ${progress}%`);
          }
        },
      });

      // Wait for both upload and ML processing simulation
      await processingPromise;

      console.log('âœ… Upload successful:', response.data);
      setUploadResult(response.data);

      // Show ML insights with delay for dramatic effect
      setTimeout(() => {
        setShowMLInsights(true);
      }, 1000);

    } catch (err: any) {
      console.error('âŒ Upload failed:', err);
      setError(err.response?.data?.detail || 'Failed to upload logs');
    } finally {
      setUploading(false);
      setUploadProgress(0);
    }
  }, [initializeMLSteps, simulateMLProcessing]);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    onDrop,
    multiple: true,
    // Accept all file types - backend will validate
    noClick: false,
    noKeyboard: false
  });

  const getSeverityColor = (severity: number) => {
    if (severity >= 0.8) return 'error';
    if (severity >= 0.6) return 'warning';
    if (severity >= 0.4) return 'info';
    return 'success';
  };

  const toggleAnomalyExpansion = (index: number) => {
    const newExpanded = new Set(expandedAnomalies);
    if (newExpanded.has(index)) {
      newExpanded.delete(index);
    } else {
      newExpanded.add(index);
    }
    setExpandedAnomalies(newExpanded);
  };

  const getMLInsightIcon = (type: string) => {
    switch (type) {
      case 'PORT_SCAN': return <NetworkCheck />;
      case 'SUSPICIOUS_IP': return <Warning />;
      case 'BRUTE_FORCE': return <Security />;
      case 'UNUSUAL_API': return <Assessment />;
      default: return <BugReport />;
    }
  };

  const getAnomalyTypeDescription = (type: string) => {
    const descriptions = {
      'PORT_SCAN': 'Systematic scanning of network ports indicating reconnaissance activity',
      'SUSPICIOUS_IP': 'IP address exhibiting unusual or potentially malicious behavior patterns',
      'BRUTE_FORCE': 'Repeated authentication attempts suggesting credential attacks',
      'UNUSUAL_API': 'Abnormal API usage patterns that deviate from baseline behavior'
    };
    return descriptions[type as keyof typeof descriptions] || 'Anomalous behavior detected by ML algorithms';
  };

  return (
    <Box sx={{ minHeight: '100vh', p: 4 }}>
      {/* Art Deco Header Section */}
      <Fade in={true} timeout={1000}>
        <Box sx={{ textAlign: 'center', mb: 8, position: 'relative' }}>
          {/* Decorative Top Line */}
          <Box sx={{ 
            position: 'absolute',
            top: 0,
            left: '50%',
            transform: 'translateX(-50%)',
            width: 300,
            height: 4,
            background: 'linear-gradient(90deg, transparent, #D4AF37, transparent)',
          }} />

          {/* Diamond Icon */}
          <Box
            sx={{
              width: 100,
              height: 100,
              backgroundColor: '#D4AF37',
              transform: 'rotate(45deg)',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              mx: 'auto',
              mb: 4,
              position: 'relative',
              boxShadow: '0 0 30px rgba(212, 175, 55, 0.3)',
              '&::before': {
                content: '""',
                position: 'absolute',
                top: 6,
                left: 6,
                right: 6,
                bottom: 6,
                border: '2px solid #0A0A0A',
              }
            }}
          >
            <Psychology 
              sx={{ 
                fontSize: 40, 
                color: '#0A0A0A',
                transform: 'rotate(-45deg)',
              }} 
            />
          </Box>

          <Typography 
            variant="h2" 
            sx={{ 
              color: '#D4AF37',
              mb: 2,
              textShadow: '0 0 20px rgba(212, 175, 55, 0.3)',
            }}
          >
            Machine Learning Analysis
          </Typography>
          <Typography 
            variant="h5" 
            sx={{ 
              color: '#888888',
              textTransform: 'uppercase',
              letterSpacing: '0.2em',
              mb: 4,
            }}
          >
            Intelligent Log Processing
          </Typography>
          <Typography 
            variant="body1" 
            sx={{ 
              color: '#F2F0E4',
              maxWidth: 800,
              mx: 'auto',
              lineHeight: 1.8,
              fontSize: '1.125rem',
            }}
          >
            Sophisticated algorithms analyze AWS logs with architectural precision, detecting behavioral anomalies 
            and generating intelligent security rules through advanced pattern recognition
          </Typography>
        </Box>
      </Fade>

      {/* Art Deco Upload Section */}
      <Slide in={true} direction="up" timeout={1200}>
        <Box 
          sx={{ 
            mb: 6, 
            border: '3px solid #D4AF37',
            position: 'relative',
            background: 'radial-gradient(circle at center, rgba(212, 175, 55, 0.05) 0%, transparent 70%)',
            '&::before': {
              content: '""',
              position: 'absolute',
              top: -3,
              left: 60,
              right: 60,
              height: 3,
              backgroundColor: '#0A0A0A',
            },
            '&::after': {
              content: '""',
              position: 'absolute',
              bottom: -3,
              left: 60,
              right: 60,
              height: 3,
              backgroundColor: '#0A0A0A',
            }
          }}
        >
          {/* Decorative Corner Elements */}
          <Box
            sx={{
              position: 'absolute',
              top: 16,
              left: 16,
              width: 40,
              height: 40,
              borderTop: '3px solid #D4AF37',
              borderLeft: '3px solid #D4AF37',
            }}
          />
          <Box
            sx={{
              position: 'absolute',
              bottom: 16,
              right: 16,
              width: 40,
              height: 40,
              borderBottom: '3px solid #D4AF37',
              borderRight: '3px solid #D4AF37',
            }}
          />

          <Box sx={{ p: 6 }}>
            <Box display="flex" alignItems="center" gap={3} mb={6}>
              {/* Diamond Icon */}
              <Box
                sx={{
                  width: 60,
                  height: 60,
                  transform: 'rotate(45deg)',
                  backgroundColor: '#D4AF37',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  '&::before': {
                    content: '""',
                    position: 'absolute',
                    top: 4,
                    left: 4,
                    right: 4,
                    bottom: 4,
                    border: '1px solid #0A0A0A',
                  }
                }}
              >
                <SmartToy sx={{ 
                  fontSize: 28, 
                  color: '#0A0A0A',
                  transform: 'rotate(-45deg)',
                }} />
              </Box>

              <Typography 
                variant="h4" 
                sx={{ 
                  color: '#D4AF37',
                  fontFamily: '"Marcellus", serif',
                  textTransform: 'uppercase',
                  letterSpacing: '0.1em',
                }}
              >
                Data Ingestion Portal
              </Typography>
            </Box>

            <Box
              {...getRootProps()}
              sx={{
                border: '2px dashed rgba(212, 175, 55, 0.5)',
                borderColor: isDragActive ? '#D4AF37' : 'rgba(212, 175, 55, 0.5)',
                borderRadius: 0,
                p: 8,
                textAlign: 'center',
                cursor: 'pointer',
                backgroundColor: isDragActive ? 'rgba(212, 175, 55, 0.05)' : 'transparent',
                transition: 'all 0.5s ease',
                position: 'relative',
                '&:hover': {
                  backgroundColor: 'rgba(212, 175, 55, 0.05)',
                  borderColor: '#D4AF37',
                  transform: 'translateY(-4px)',
                  boxShadow: '0 8px 32px rgba(212, 175, 55, 0.2)',
                },
                '&::before': {
                  content: '""',
                  position: 'absolute',
                  top: 24,
                  left: 24,
                  width: 32,
                  height: 32,
                  borderTop: '2px solid rgba(212, 175, 55, 0.3)',
                  borderLeft: '2px solid rgba(212, 175, 55, 0.3)',
                },
                '&::after': {
                  content: '""',
                  position: 'absolute',
                  bottom: 24,
                  right: 24,
                  width: 32,
                  height: 32,
                  borderBottom: '2px solid rgba(212, 175, 55, 0.3)',
                  borderRight: '2px solid rgba(212, 175, 55, 0.3)',
                }
              }}
            >
              <input {...getInputProps()} />

              {/* Diamond Upload Icon */}
              <Zoom in={true} timeout={1500}>
                <Box
                  sx={{
                    width: 120,
                    height: 120,
                    transform: 'rotate(45deg)',
                    backgroundColor: isDragActive ? '#D4AF37' : 'rgba(212, 175, 55, 0.1)',
                    border: '3px solid #D4AF37',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    mx: 'auto',
                    mb: 6,
                    transition: 'all 0.3s ease',
                    boxShadow: isDragActive ? '0 0 30px rgba(212, 175, 55, 0.4)' : '0 0 15px rgba(212, 175, 55, 0.2)',
                    '&::before': {
                      content: '""',
                      position: 'absolute',
                      top: 6,
                      left: 6,
                      right: 6,
                      bottom: 6,
                      border: '2px solid #0A0A0A',
                    }
                  }}
                >
                  <CloudUpload sx={{ 
                    fontSize: 48, 
                    color: isDragActive ? '#0A0A0A' : '#D4AF37',
                    transform: 'rotate(-45deg)',
                  }} />
                </Box>
              </Zoom>

              <Typography 
                variant="h3" 
                sx={{ 
                  mb: 3, 
                  color: '#D4AF37',
                  fontFamily: '"Marcellus", serif',
                  textTransform: 'uppercase',
                  letterSpacing: '0.1em',
                  textShadow: '0 0 15px rgba(212, 175, 55, 0.3)',
                }}
              >
                {isDragActive ? 'Release for Analysis' : 'Upload Log Files'}
              </Typography>
              <Typography 
                variant="h6" 
                sx={{ 
                  mb: 4,
                  color: '#F2F0E4',
                  lineHeight: 1.6,
                }}
              >
                Deploy your AWS log files for sophisticated machine learning analysis
              </Typography>

              {/* Log Type Chips */}
              <Box display="flex" justifyContent="center" gap={3} flexWrap="wrap">
                {[
                  { label: 'VPC Flow', roman: 'I' },
                  { label: 'CloudTrail', roman: 'II' },
                  { label: 'WAF Logs', roman: 'III' },
                  { label: 'ALB Logs', roman: 'IV' },
                  { label: 'IAM Logs', roman: 'V' }
                ].map((logType, index) => (
                  <Chip 
                    key={index}
                    label={
                      <Box display="flex" alignItems="center" gap={1}>
                        <Typography variant="caption" sx={{ fontFamily: '"Marcellus", serif' }}>
                          {logType.roman}
                        </Typography>
                        <Typography variant="body2">
                          {logType.label}
                        </Typography>
                      </Box>
                    }
                    sx={{ 
                      bgcolor: 'rgba(212, 175, 55, 0.1)', 
                      color: '#D4AF37',
                      border: '1px solid rgba(212, 175, 55, 0.3)',
                      borderRadius: 0,
                      px: 2,
                      py: 1,
                      '&:hover': {
                        bgcolor: 'rgba(212, 175, 55, 0.2)',
                      },
                      transition: 'all 0.3s ease',
                    }} 
                  />
                ))}
              </Box>
            </Box>
          </Box>
        </Box>
      </Slide>

      {/* Art Deco ML Processing Steps */}
      {uploading && (
        <Fade in={uploading} timeout={500}>
          <Box 
            sx={{ 
              mb: 6, 
              border: '3px solid #D4AF37',
              position: 'relative',
              background: 'radial-gradient(circle at center, rgba(212, 175, 55, 0.08) 0%, transparent 70%)',
            }}
          >
            {/* Decorative Corner Elements */}
            <Box
              sx={{
                position: 'absolute',
                top: 16,
                left: 16,
                width: 32,
                height: 32,
                borderTop: '3px solid #D4AF37',
                borderLeft: '3px solid #D4AF37',
              }}
            />
            <Box
              sx={{
                position: 'absolute',
                bottom: 16,
                right: 16,
                width: 32,
                height: 32,
                borderBottom: '3px solid #D4AF37',
                borderRight: '3px solid #D4AF37',
              }}
            />

            {/* Header */}
            <Box sx={{ 
              p: 4, 
              borderBottom: '1px solid rgba(212, 175, 55, 0.3)',
              textAlign: 'center',
            }}>
              <Box display="flex" alignItems="center" justifyContent="center" gap={3} mb={3}>
                {/* Animated Diamond */}
                <Box
                  sx={{
                    width: 60,
                    height: 60,
                    transform: 'rotate(45deg)',
                    backgroundColor: '#D4AF37',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    animation: 'pulse 2s infinite',
                    '@keyframes pulse': {
                      '0%': {
                        boxShadow: '0 0 0 0 rgba(212, 175, 55, 0.7)',
                      },
                      '70%': {
                        boxShadow: '0 0 0 20px rgba(212, 175, 55, 0)',
                      },
                      '100%': {
                        boxShadow: '0 0 0 0 rgba(212, 175, 55, 0)',
                      },
                    },
                  }}
                >
                  <Analytics sx={{ 
                    fontSize: 28, 
                    color: '#0A0A0A',
                    transform: 'rotate(-45deg)',
                  }} />
                </Box>

                <Typography 
                  variant="h4" 
                  sx={{ 
                    color: '#D4AF37',
                    fontFamily: '"Marcellus", serif',
                    textTransform: 'uppercase',
                    letterSpacing: '0.1em',
                  }}
                >
                  ML Pipeline Active
                </Typography>
              </Box>

              {/* Art Deco Progress Bar */}
              <Box sx={{ position: 'relative', width: '100%', maxWidth: 500, mx: 'auto' }}>
                <Box
                  sx={{
                    height: 12,
                    backgroundColor: 'rgba(212, 175, 55, 0.2)',
                    border: '2px solid #D4AF37',
                    position: 'relative',
                    overflow: 'hidden',
                  }}
                >
                  <Box
                    sx={{
                      height: '100%',
                      width: `${uploadProgress}%`,
                      background: 'linear-gradient(90deg, #D4AF37, #F2E8C4, #D4AF37)',
                      transition: 'width 0.3s ease',
                    }}
                  />
                  <Box
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      right: 0,
                      bottom: 0,
                      background: 'linear-gradient(90deg, transparent, rgba(255,255,255,0.3), transparent)',
                      animation: 'shimmer 2s infinite',
                      '@keyframes shimmer': {
                        '0%': { transform: 'translateX(-100%)' },
                        '100%': { transform: 'translateX(100%)' },
                      },
                    }}
                  />
                </Box>
              </Box>
            </Box>

            {/* Processing Steps */}
            <Box sx={{ p: 4 }}>
              <Grid container spacing={4}>
                {processingSteps.map((step, index) => (
                  <Grid item xs={12} md={6} lg={4} key={step.id}>
                    <Box
                      sx={{
                        textAlign: 'center',
                        position: 'relative',
                        opacity: step.completed ? 1 : step.active ? 1 : 0.5,
                        transition: 'all 0.5s ease',
                      }}
                    >
                      {/* Roman Numeral */}
                      <Typography
                        sx={{
                          position: 'absolute',
                          top: -10,
                          right: 0,
                          fontSize: '2rem',
                          fontFamily: '"Marcellus", serif',
                          color: 'rgba(212, 175, 55, 0.3)',
                          lineHeight: 1,
                        }}
                      >
                        {['I', 'II', 'III', 'IV', 'V', 'VI'][index]}
                      </Typography>

                      {/* Diamond Step Icon */}
                      <Box
                        sx={{
                          width: 80,
                          height: 80,
                          transform: 'rotate(45deg)',
